package actions

import (
	"encoding/json"
	"factorihub/models"
	"github.com/gobuffalo/buffalo"
	"io/ioutil"
	"net/http"
)

// BlueprintHandler is a default handler to serve up
// a blueprint page.
func BlueprintHandler(c buffalo.Context) error {
	var bp models.BlueprintData

	bp.BlueprintBook = models.BlueprintBook{
		Author: models.User{
			Name:   "silverwyrm",
			Avatar: "silverwyrm.jpg",
		},
		Favorites: 545,
		Labels:    []string{"tileable", "science", "mall", "train"},
		Image:     "gearmall.jpg",
		Version: models.VersionString{
			Major:  1,
			Minor:  0,
			Hotfix: 0,
			Dev:    0,
		},
		RedditThread: "https://reddit.com/r/factorio/comments/is3mxa/the_gear_a_mall",
		RawString:    ``,
	}

	data, err := ioutil.ReadFile("dist/blueprint.json")
	if err != nil {
		return err
	}

	err = json.Unmarshal(data, &bp)
	if err != nil {
		return err
	}

	c.Set("blueprint", bp.BlueprintBook)
	c.Set("latestVersion", "1.0.0")

	return c.Render(http.StatusOK, r.HTML("blueprint.html"))
}
